const {
    openBrowser,
    goto,
    press,
    write
  } = require("taiko");

export default login = async () => {
    await openBrowser({ headless: false });
    await goto("http://localhost:3000/");
    await press("Tab");
    await write("admin");
    await press("Tab");
    await write("admin");
    await press("Enter");
  };